--
-- Bẫy `mtc_playlist_details`
--
DELIMITER $$
CREATE TRIGGER `tg_check_update_time` BEFORE UPDATE ON `mtc_playlist_details` FOR EACH ROW BEGIN


DECLARE count_id INT;
    
    
    SET count_id = 0;
   
    IF DATE_FORMAT(new.time_begin,"%T") >= DATE_FORMAT(new.time_end,"%T") THEN
    signal sqlstate '45000'  SET MESSAGE_TEXT = "The start time or the end time is incorrect!";
    ELSE
    SELECT COUNT(*) INTO count_id FROM mtc_playlist_details as pd WHERE
    pd.playlistdetail_id <> new.playlistdetail_id AND
   ( DATE_FORMAT(new.time_begin,"%T") BETWEEN DATE_FORMAT(pd.time_begin,"%T") AND DATE_FORMAT(pd.time_end,"%T") OR
     DATE_FORMAT(new.time_end,"%T") BETWEEN DATE_FORMAT(pd.time_begin,"%T") AND DATE_FORMAT(pd.time_end,"%T")
    OR DATE_FORMAT(pd.time_begin,"%T") BETWEEN DATE_FORMAT(new.time_begin,"%T") AND DATE_FORMAT(new.time_end,"%T") OR
    DATE_FORMAT(pd.time_end,"%T") BETWEEN DATE_FORMAT(new.time_begin,"%T") AND DATE_FORMAT(new.time_end,"%T")) AND new.playlist_id = pd.playlist_id AND pd.playlistdetail_id <> new.playlistdetail_id AND new.time_begin < new.time_end ;
	IF count_id > 0 THEN
    signal sqlstate '45000'  SET MESSAGE_TEXT = "The start time or the end time is incorrect!";
    END IF;
    END IF;

END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `tg_insert_check_time` BEFORE INSERT ON `mtc_playlist_details` FOR EACH ROW BEGIN
	DECLARE count_id INT;
   
    SET count_id = 0;
    IF DATE_FORMAT(new.time_begin,"%T") >= DATE_FORMAT(new.time_end,"%T") THEN
    signal sqlstate '45000'  SET MESSAGE_TEXT = "The start time or the end time is incorrect123!";
    ELSE
    SELECT COUNT(*) INTO count_id FROM mtc_playlist_details as pd WHERE
    pd.playlist_detail_status = 1 AND
    
   ( DATE_FORMAT(new.time_begin,"%T") BETWEEN DATE_FORMAT(pd.time_begin,"%T") AND DATE_FORMAT(pd.time_end,"%T") OR
     DATE_FORMAT(new.time_end,"%T") BETWEEN DATE_FORMAT(pd.time_begin,"%T") AND DATE_FORMAT(pd.time_end,"%T")
    OR DATE_FORMAT(pd.time_begin,"%T") BETWEEN DATE_FORMAT(new.time_begin,"%T") AND DATE_FORMAT(new.time_end,"%T") OR
    DATE_FORMAT(pd.time_end,"%T") BETWEEN DATE_FORMAT(new.time_begin,"%T") AND DATE_FORMAT(new.time_end,"%T")) AND new.playlist_id = pd.playlist_id AND new.time_begin < new.time_end;
	IF count_id > 0 THEN
    signal sqlstate '45000' SET MESSAGE_TEXT = "The start time or the end time duplicate!";
    END IF;
    END IF;
END
$$
DELIMITER ;

